import numpy as np

# Define distribution functions for each feature
def target_material():
    materials = ['aluminium', 'gold', 'plastic', 'polypropylene']
    return random.choice(materials)

def target_thickness():
    p = np.random.normal(loc=1.02, scale=np.sqrt(16.9), size=1)
    return p

def pulse_width():
    p = np.random.lognormal(loc=np.log(30), scl=np.sqrt(1030000), size=1)
    return np.exp(p)

def energy():
    p = np.random.normal(loc=13.9, scale=np.sqrt(2350), size=1)
    return p

def spot_size():
    p = np.random.normal(loc=3.61, scale=np.sqrt(13.7), size=1)
    return p

def intensity():
    p = np.random.lognormal(loc=np.log(5.10e20), scl=np.sqrt(3.96e41), size=1)
    return np.exp(p)

def power():
    p = np.random.normal(loc=6.23e13, scale=np.sqrt(4.03e27), size=1)
    return np.math.pow(10, p)

def cutoff_energy():
    p = np.random.normal(loc=8.64, scale=np.sqrt(156), size=1)
    return p

data = [
  [target_material(), target_thickness(), pulse_width(), energy(), spot_size(), intensity(), power(), cutoff_energy()],
  [target_material(), target_thickness(), pulse_width(), energy(), spot_size(), intensity(), power(), cutoff_energy()],
  # ... Add the rest of the data points here
]

# Print the first five generated samples
for sample in data[:5]:
    print(sample)
```

